import React from 'react';

class Contact extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="w-100 p-5" style={{height: 'fit-content', backgroundColor: '#CAF0F8', color: '#03045E'}}>
         <h1>Contact</h1>
         <form class="container d-flex flex-column container-fluid text-start rounded-4 p-3" style={{border:'2px solid #03045E', maxWidth: '60%'}}>
            <label for="email" className="d-flex flex-column my-2">Email
            <input id="email" type="email" placeHolder="Enter your email" className="" />
            </label> 
            <label for="name" className="d-flex flex-column my-2">Name
            <input id="name" type="text" placeHolder="Enter your name" className="" />
            </label>
            <label for="message" className="d-flex flex-column my-2">Got some info for me?
            <input id="name" type="text" placeHolder="Message" style={{height: 100}} />
            </label>
            <button type="submit" className="btn btn-primary block my-2">Message Me</button>
         </form>
      </div>
    );
  }
}

export { Contact }
